import{_ as e}from"./chunks/data-cloud-guest-new-stream-s3.CKCAcPRW.js";import{_ as a,c as o,a1 as r,o as s}from"./chunks/framework.BRP8cXOc.js";const i="/agentforce-workshop/data-cloud-reservation-new-stream-csv.l5ufR92k.webp",n="/agentforce-workshop/data-cloud-reservation-new-stream-details.CLXrjXDl.webp",d="/agentforce-workshop/data-cloud-reservation-new-custom-dmo.DuKy9OSl.webp",l="/agentforce-workshop/data-cloud-reservation-custom-dmo-fields.D09_Aimt.webp",c="/agentforce-workshop/data-cloud-reservation-custom-dmo-mappings.dZMpB-jw.webp",p="/agentforce-workshop/data-cloud-reservation-relationship.BjKaBUCS.webp",h="data:image/webp;base64,",m="/agentforce-workshop/data-cloud-reservation-graph.iS7xMCFe.webp",R=JSON.parse('{"title":"Exercise 3: Ingest Reservations from Amazon S3","description":"","frontmatter":{},"headers":[],"relativePath":"agentforce-workshop/data-cloud/3-ingest-s3-reservations.md","filePath":"agentforce-workshop/data-cloud/3-ingest-s3-reservations.md"}'),u={name:"agentforce-workshop/data-cloud/3-ingest-s3-reservations.md"};function g(v,t,b,f,C,k){return s(),o("div",null,t[0]||(t[0]=[r('<h1 id="exercise-3-ingest-reservations-from-amazon-s3" tabindex="-1">Exercise 3: Ingest Reservations from Amazon S3 <a class="header-anchor" href="#exercise-3-ingest-reservations-from-amazon-s3" aria-label="Permalink to &quot;Exercise 3: Ingest Reservations from Amazon S3&quot;">​</a></h1><p>Coral Cloud Resorts stores reservations in Amazon S3. In this exercise, you will:</p><ol><li><p>Create a data stream that ingests reservations into Data Cloud.</p></li><li><p>Create a custom data model object named Reservation.</p></li><li><p>Create a many-to-one relationship between the Reservation and Individual data model objects.</p></li></ol><h2 id="step-1-create-the-reservation-data-stream" tabindex="-1">Step 1: Create the Reservation data stream <a class="header-anchor" href="#step-1-create-the-reservation-data-stream" aria-label="Permalink to &quot;Step 1: Create the Reservation data stream&quot;">​</a></h2><p>In this step, you&#39;ll create a data stream that ingests reservations from Amazon S3.</p><ol><li><p>Click the <strong>Data Streams</strong> tab.</p></li><li><p>Click <strong>New</strong>.</p></li><li><p>Under <strong>Other Sources</strong>, click <strong>Amazon S3</strong>, and click <strong>Next</strong>.</p><p><img src="'+e+'" alt="" data-zoomable="true"></p></li><li><p>Configure the data stream with the following values:</p><table tabindex="0"><thead><tr><th><strong>Field</strong></th><th><strong>Value</strong></th></tr></thead><tbody><tr><td>Connection</td><td><code>Coral Cloud Resorts S3 Connection</code></td></tr><tr><td>File Type</td><td><code>CSV</code></td></tr><tr><td>Import from Directory</td><td>Leave blank</td></tr><tr><td>File Name</td><td><code>Coral_Clouds_Hotel_Reservations.csv</code></td></tr><tr><td>Source</td><td>Keep default: <code>AwsS3_Coral_Cloud_S3_Connection</code></td></tr></tbody></table><p><img src="'+i+'" alt="" data-zoomable="true"></p></li><li><p>Click <strong>Next</strong>.</p></li><li><p>Continue configuring the data stream with the following values (keep the default values for all other fields):</p><table tabindex="0"><thead><tr><th><strong>Field</strong></th><th><strong>Value</strong></th></tr></thead><tbody><tr><td>Data Lake Object Label</td><td><code>Reservation</code></td></tr><tr><td>Data Lake Object API Name</td><td>Keep default</td></tr><tr><td>Category</td><td><code>Engagement</code></td></tr><tr><td>Event Time Field</td><td><code>Creation Date</code></td></tr><tr><td>Primary Key</td><td><code>Reservation ID</code></td></tr><tr><td>Room Number Data Type</td><td><code>Text</code></td></tr></tbody></table><p>Use the screenshot below to make sure you set all the right values.</p><p><img src="'+n+'" alt="" data-zoomable="true"></p></li><li><p>Click <strong>Next</strong>.</p></li><li><p>Keep the default values, and click <strong>Deploy</strong>.</p></li><li><p>Make sure the Data Stream Status is Active. When it is, click <strong>Refresh Now</strong> to populate the Reservation DLO.</p></li><li><p>Keep the default option and click <strong>Refresh Now</strong>.</p></li></ol><h2 id="step-2-create-a-custom-data-model-object" tabindex="-1">Step 2: Create a custom data model object <a class="header-anchor" href="#step-2-create-a-custom-data-model-object" aria-label="Permalink to &quot;Step 2: Create a custom data model object&quot;">​</a></h2><p>When you have industry-specific objects that don&#39;t have an equivalent in the Customer 360 Data Model, you can extend the Customer 360 Data Model with custom data model objects. In this step, you&#39;ll create a custom data model object to represent reservations in the hospitality industry.</p><ol><li><p>From the <strong>Reservation</strong> data stream, click the <strong>Start</strong> button in the <strong>Data Mapping</strong> panel.</p></li><li><p>In the data model entities panel, click the <strong>Select Objects</strong> button.</p></li><li><p>Click the <strong>Custom Data Model</strong> tab.</p></li><li><p>Click <strong>New Custom Object</strong>.</p><p><img src="'+d+'" alt="" data-zoomable="true"></p></li><li><p>Keep the default selection and click <strong>Save</strong>.</p><p><img src="'+l+'" alt="" data-zoomable="true"></p></li><li><p>Examine the mappings. Because the Reservation custom data model object (DMO) was created based on your Reservation data lake object (DLO), each field in the data lake object has been automatically mapped to its corresponding field in the data model object.</p><p><img src="'+c+'" alt="" data-zoomable="true"></p></li><li><p>Click <strong>Save &amp; Close</strong>.</p></li></ol><h2 id="step-3-create-the-reservation-to-individual-relationship" tabindex="-1">Step 3: Create the Reservation-to-Individual relationship <a class="header-anchor" href="#step-3-create-the-reservation-to-individual-relationship" aria-label="Permalink to &quot;Step 3: Create the Reservation-to-Individual relationship&quot;">​</a></h2><p>In this step, you&#39;ll create a many-to-one relationship between the Reservation object and the Individual object.</p><ol><li><p>Click the <strong>Data Model</strong> tab.</p></li><li><p>Click the <strong>Reservation</strong> data model object (DMO).</p></li><li><p>Click the <strong>Relationships</strong> tab.</p></li><li><p>Click <strong>New</strong>.</p></li><li><p>In the Edit Relationships dialog, click the <strong>+ New Relationship</strong> button.</p></li><li><p>Configure your relationship as follows:</p><table tabindex="0"><thead><tr><th><strong>Field</strong></th><th><strong>Value</strong></th></tr></thead><tbody><tr><td>Field</td><td><code>Contact ID</code></td></tr><tr><td>Cardinality</td><td><code>N:1</code></td></tr><tr><td>Related Object</td><td><code>Individual</code></td></tr><tr><td>Related Field</td><td><code>Individual Id</code></td></tr></tbody></table><p><img src="'+p+'" alt="" data-zoomable="true"></p></li><li><p>Click <strong>Save &amp; Close</strong>.</p></li><li><p>To visualize the new relationship, click the <strong>Data Model</strong> tab, click the <strong>Display as</strong> menu icon, and select <strong>Graph</strong>.</p><p><img src="'+h+'" alt="" data-zoomable="true"></p></li><li><p>Make sure that the Reservation data model object (DMO) has a many-to-one relationship with the Individual DMO.</p><p><img src="'+m+'" alt="" data-zoomable="true"></p></li></ol><h2 id="summary" tabindex="-1">Summary <a class="header-anchor" href="#summary" aria-label="Permalink to &quot;Summary&quot;">​</a></h2><p>In this exercise, you created a data stream that ingests reservations from Amazon S3 into a Reservation data lake object (DLO). Because the Customer 360 Data Model doesn&#39;t have a standard data model object to represent reservations, you created a custom Reservation data model object. You then defined a many-to-one relationship between the Reservation and the Individual data model objects.</p>',14)]))}cons